import React from "react";
// import Sidebar from './components/Sidebar'
// import Center from './components/Center'
import './index.css';
import 'bootstrap/dist/css/bootstrap.min.css';
// import Container from 'react-bootstrap/Container';
// import Row from 'react-bootstrap/Row';
// import Col from 'react-bootstrap/Col';
// import Button from 'react-bootstrap/Button';
// import Form from 'react-bootstrap/Form';
import { Form, Button, Label, Input, Col, Row, FormGroup } from 'reactstrap';
import axios from 'axios';

function App() {

    let formData = new FormData();

    const onFileChange = (e) => {
        console.log(e.target.files[0])
        if(e.target && e.target.files[0]) {
            formData.append('file', e.target.files[0]);
        }
    }
    const SubmitFileData = () => {
      axios.post(
        'https://v2.convertapi.com/upload',
          {formData}
      )
      .then(res => {
        console.log(res);
      })
      .catch(error => {
        console.log(error);
      })
    }

    return (
    <>
    <h2>App</h2>
    <Form>
      <FormGroup className="mb-3" controlId="formFile">
        <Label for="exFile" >File Upload</Label>
        <Input type="file" name="file-upload" id="exFile" onChange={onFileChange} />
      </FormGroup>

      <Button variant="primary" type="submit">
        Submit
      </Button>

        <FormGroup as={Row} className="mb-3">
            <Label for="exampleSelect">
              Select
            </Label>
            <Input
              id="exampleSelect"
              name="select"
              type="select"
            >
              <option>
                1
              </option>
              <option>
                2
              </option>
              <option>
                3
              </option>
              <option>
                4
              </option>
              <option>
                5
              </option>
            </Input>
        </FormGroup>
      <FormGroup>
        <Label for="exampleNumber">
          Number
        </Label>
        <Input
          id="exampleNumber"
          name="number"
          placeholder="number placeholder"
          type="number"
        />
      </FormGroup>

        <FormGroup as={Row} className="mb-3">
          <Col sm={{ span: 10, offset: 2 }}>
            <Button onClick={SubmitFileData}>Submit File</Button>
          </Col>
        </FormGroup>
    </Form>
          {/* <Sidebar /> */}
          {/* <Center /> */}
    </>
  );
}

export default App;
